import React, { useCallback, useState } from 'react'
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import PhoneIcon from '@mui/icons-material/Phone';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import FavoriteIcon from '@mui/icons-material/Favorite';
import SearchIcon from '@mui/icons-material/Search';
import logo from '../assets/img/logo/logo.png';
import { useLocation, useNavigate } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import LogoutIcon from '@mui/icons-material/Logout';
import { getProducts, searchProducts } from '../store/actions/products';
import CategoryData from './CategoryData';
import Modal from 'react-modal'



export default function Header() {
    const dispatch = useDispatch();
    const navigate = useNavigate();
    const [likeValue, setLikeValue] = useState(0);
    const [cardValue, setCardValue] = useState(0);
    const [value, setValue] = useState('');
    const [open, setOpen] = useState(false)

    const userToken = localStorage.getItem("userToken")
    const userData = localStorage.getItem("userData")


    const handleSubmit = useCallback(async (e) => {
        e.preventDefault()
        if (value.length) {
            await dispatch(searchProducts(value));
            const product = '/products?q=';
            navigate(`${product}${value}`);
        } else {
            alert('Value is not defined');
        }
    }, [value]);






    return (
        <>
            <header>
                <div id="topHeader">
                    <div className="container">
                        <ul className="headerLinks pullLeft">
                            <li>
                                <a href='tel:+37477053242' className='phoneNumber'>
                                    <PhoneIcon style={{ fontSize: 30, color: 'white' }} />
                                    <b>+37477053242</b>
                                </a>
                            </li>
                        </ul>
                        <ul className="headerLinks pullRight">
                            <a href='/account'>
                                <AccountCircleIcon style={{ fontSize: 40, color: '#fff' }} />
                            </a>
                            {userToken ?
                                <div>
                                    <button onClick={() => setOpen(!open)} className='logOut'><LogoutIcon style={{ fontSize: 40, color: 'white' }} /></button>
                                    <div>
                                     {open ?  
                                     <modal>



                                     </modal>


                                    : 


                                    null
                                    }


                                    </div>


                                </div>
                                :
                                null
                            }
                        </ul>
                    </div>
                </div>
                <div id="header">
                    <div className="container">
                        <div className="headerLine">
                            <div className="headerLogo">
                                <a href="/" className="logo">
                                    <img src={logo} alt="logo" />
                                </a>
                            </div>
                            <div className="headerSearch">
                                <form onSubmit={(event) => handleSubmit(event)}>
                                    <label>
                                        <input value={value} onChange={(ev) => setValue(ev.target.value)}
                                            type='search'
                                            className="input" placeholder="Search" />
                                    </label>
                                    <button type='submit' className="searchBtn"><SearchIcon style={{ fontSize: 30 }} />
                                    </button>
                                </form>
                            </div>
                            <div className="clearfix">
                                <div className="headerCtn">
                                    <div className='likeCorner'>
                                        <button className='btnIcon'>
                                            <FavoriteIcon style={{ fontSize: 40, color: 'red', }} />
                                            <span className="qty liked">{likeValue}</span>
                                        </button>
                                    </div>
                                    <div className='cartCorner'>
                                        <button onClick={() => navigate('/cart')} className='btnIcon'>
                                            <ShoppingCartIcon style={{ fontSize: 40, color: 'lightcyan' }} />
                                            <span className="qty cart">{cardValue}</span>
                                        </button>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </header>
        </>
    )
}
